###

 By the rules of exponents, we have
\begin{align*}
{(3^k)}^6 &=3^6 \\
3^{6k} &=3^6 \quad \color{red}{\checkmark}
\end{align*}
to make sure that the bases are the same and the powers are the same (I have used red marker to indicate that the bases are the same and the powers are the same).
